INSERT INTO `tbldesignation` (`designation_id`, `designation_title`, `slug`, `designation_desc`, `day_notice_period`, `ot_multiplier`, `created_by`, `created_datetime`, `updated_by`, `updated_datetime`) VALUES
(1, 'Super Admin', 'super-admin', '&lt;li&gt;Write â€œcleanâ€, well-designed code&lt;/li&gt;&lt;li&gt;Produce detailed specifications&lt;/li&gt;&lt;li&gt;Troubleshoot, test and maintain the core product software and databases to ensure strong optimization and functionality&lt;/li&gt;&lt;li&gt;Contribute in all phases of the development lifecycle&lt;/li&gt;&lt;li&gt;Follow industry best practices&lt;/li&gt;&lt;li&gt;Develop and deploy new features to facilitate related procedures and tools if necessary&lt;/li&gt;', '0', 1.00, 'miral', '2023-03-21 04:56:00', 'miral', '2023-03-21 04:56:00'),
(2, 'Senior Software Developer', 'senior-software-developer', '&lt;li&gt;Write â€œcleanâ€, well-designed code&lt;/li&gt;&lt;li&gt;Produce detailed specifications&lt;/li&gt;&lt;li&gt;Troubleshoot, test and maintain the core product software and databases to ensure strong optimization and functionality&lt;/li&gt;&lt;li&gt;Contribute in all phases of the development lifecycle&lt;/li&gt;&lt;li&gt;Follow industry best practices&lt;/li&gt;&lt;li&gt;Develop and deploy new features to facilitate related procedures and tools if necessary&lt;/li&gt;', '35', 1.00, 'miral', '2020-07-24 06:47:00', 'miral', '2022-08-10 12:36:28'),
(3, 'Software Developer', 'software-developer', '&lt;li&gt;Write â€œcleanâ€, well-designed code&lt;/li&gt;&lt;li&gt;Produce detailed specifications&lt;/li&gt;&lt;li&gt;Troubleshoot, test and maintain the core product software and databases to ensure strong optimization and functionality&lt;/li&gt;&lt;li&gt;Contribute in all phases of the development lifecycle&lt;/li&gt;&lt;li&gt;Follow industry best practices&lt;/li&gt;&lt;li&gt;Develop and deploy new features to facilitate related procedures and tools if necessary&lt;/li&gt;', '35', 1.00, 'miral', '2020-07-24 07:27:37', 'miral', '2022-08-10 12:36:04'),
(4, 'Mobile Application Developer ', 'mobile-application-developer', '&lt;li&gt;Support the entire application lifecycle (concept, design, test, release and support)&lt;/li&gt;&lt;li&gt;Produce fully functional mobile applications writing clean code&lt;/li&gt;&lt;li&gt;Develop application programming interfaces (APIs) to support mobile functionality&lt;/li&gt;&lt;li&gt;Suggest and implement new mobile products, applications and protocols&lt;/li&gt;&lt;li&gt;Gather specific requirements and suggest solutions&lt;/li&gt;&lt;li&gt;Write unit and UI tests to identify malfunctions&lt;/li&gt;&lt;li&gt;Troubleshoot and debug to optimize performance&lt;/li&gt;&lt;li&gt;Design interfaces to improve user experience&lt;/li&gt;&lt;li&gt;Liaise with Product development team to plan new features&lt;/li&gt;&lt;li&gt;Ensure new and legacy applications meet quality standards&lt;/li&gt;&lt;li&gt;Research and suggest new mobile products, applications and protocols&lt;/li&gt;&lt;li&gt;Stay up-to-date with new technology trends&lt;/li&gt;', '35', 1.00, 'miral', '2020-07-24 07:29:48', 'miral', '2021-09-14 09:36:25'),
(5, 'Senior Mobile Application Developer', 'senior-mobile-application-developer', '<li>Support the entire application lifecycle (concept, design, test, release and support)</li><li>Produce fully functional mobile applications writing clean code</li><li>Develop application programming interfaces (APIs) to support mobile functionality</li><li>Suggest and implement new mobile products, applications and protocols</li><li>Gather specific requirements and suggest solutions</li><li>Write unit and UI tests to identify malfunctions</li><li>Troubleshoot and debug to optimize performance</li><li>Design interfaces to improve user experience</li><li>Liaise with Product development team to plan new features</li><li>Ensure new and legacy applications meet quality standards</li><li>Research and suggest new mobile products, applications and protocols</li><li>Stay up-to-date with new technology trends</li>', '35', 1.00, 'miral', '2020-07-24 07:30:49', 'miral', '2021-05-24 08:28:48'),
(7, 'UI / UX Designer', 'ui--ux-designer', '<li>Gather and evaluate user requirements in collaboration with product managers and engineers</li><li>Illustrate design ideas using storyboards, process flows and sitemaps</li><li>Design graphic user interface elements, like menus, tabs and widgets</li><li>Build page navigation buttons and search fields</li><li>Develop UI mockups and prototypes that clearly illustrate how sites function and look like</li><li>Create original graphic designs (e.g. images, sketches and tables)</li><li>Prepare and present rough drafts to internal teams and key stakeholders</li><li>Identify and troubleshoot UX problems (e.g. responsiveness)</li><li>Conduct layout adjustments based on user feedback</li><li>Adhere to style standards on fonts, colors and images</li>', '35', 1.00, 'miral', '2020-07-24 07:33:23', 'miral', '2021-05-24 08:28:32'),
(8, 'Graphic Designer ', 'graphic-designer', '<li>Study design briefs and determine requirements</li><li>Schedule projects and define budget constraints</li><li>Conceptualize visuals based on requirements</li><li>Prepare rough drafts and present ideas</li><li>Develop illustrations, logos and other designs using software or by hand</li><li>Use the appropriate colors and layouts for each graphic</li><li>Work with copywriters and creative director to produce final design</li><li>Test graphics across various media</li><li>Amend designs after feedback</li><li>Ensure final graphics and layouts are visually appealing and on-brand</li>', '35', 1.00, 'miral', '2020-07-24 07:34:27', 'miral', '2021-05-24 08:28:16'),
(9, 'Admin Technical Support', 'admin-technical-support', '', '35', 1.00, 'miral', '2020-07-24 07:35:53', 'miral', '2022-04-27 06:27:54'),
(10, 'Tele-Sales', 'tele-sales', '<ul><li>Answering phones and explaining the product and services offered by the company.</li><li>Contacting existing customers as well as prospective customers using scripts.</li><li>Obtaining customer information and other relevant data.</li><li>Asking questions to the customer and understanding their specifications.</li><li>Resolving queries and issues related to the products and services.</li><li>Making recordings of all the sales phone calls and sales deals.</li><li>Taking and processing product orders in a professional manner.</li><li>Maintaining the database of the customers on a regular basis.</li><li>Suggesting solutions based on customerâ€™s needs and requirements.</li></ul>', '35', 1.00, 'miral', '2020-07-24 07:37:18', 'miral', '2021-05-24 08:27:36'),
(11, 'Front Desk Executive', 'front-desk-executive', '<div>Objectives of this Role</div><ul><li>Optimize office operations, overseeing internal processes, supplies, and equipment</li><li>Coordinate external resources and vendors, nurturing relationships and upholding best practices</li><li>Serve as the first impression of our business, welcoming visitors, responding to requests, and supporting coworkers</li><li>Encourage efficient scheduling, workflows, communications, and office operations on a daily basis</li><li>Recognize issues requiring immediate attention from routine, and communicate to operational leadership any changes from standard operation</li></ul><div>Daily and Monthly Responsibilities</div><ul><li>Open the office, greet visitors in a friendly manner, answer/direct phone calls, manage mail, faxes, and shipments, send and respond to emails, manage printing and copying</li><li>Oversee standard office equipment and supplies, such as printer, ink or toner, paper, etc. Report any malfunctions to the appropriate person or department</li><li>Prepare conference rooms for meetings and organize catering, as requested</li><li>Type up memos, meeting minutes, letters, reports, forms, and similar content from dictation</li><li>Maintain detailed calendars, coordinate schedules, prioritize meeting requests and logistics, and arrange all aspects of travel</li><li>Establish and maintain record-keeping system for contacts, files, and employee directory</li></ul>', '35', 1.00, 'miral', '2020-07-24 07:38:12', 'miral', '2021-05-24 08:27:18'),
(12, 'Business Development Associate', 'business-development-associate', '<div>Objectives of this Role</div><ul><li>Managing both our existing sales pipeline and developing new business opportunities</li><li>Take a lead role in the development of proposals and presentations for new business materials to create and nurture business opportunities and partnerships</li><li>Identify trends and customer needs, building a short/medium/long-term sales pipeline in accordance with targets</li><li>Develop strategies and positions by analyzing new venture integration</li><li>Assist in the coordination and implementation of marketing strategies, and delegate tasks that achieve strategic goals</li><li>Motivate the team, track performance, and report metrics</li></ul><div>Daily and Monthly Responsibilities</div><ul><li>Monitor and evaluate industry trends and customer drivers and meet regularly with management and stakeholders to discuss strategy</li><li>Manage proposal response process, including detailed RFP requirements, content creation, and &nbsp;inputs from various sources</li><li>Generate new leads, identify and contact decision-makers, screen potential business opportunities, select the deals inline with strategies, and lead and facilitate pitch logistics</li><li>Develop and implement overarching outbound sales and business development strategy, sales processes, structure, and best practices across the company</li><li>Support deal structure and pricing with business value analysis; negotiate prices for proactive bids and proposals</li><li>Maintain and share professional knowledge through education, networking, events, and presentations</li></ul>', '35', 1.00, 'miral', '2020-07-24 07:39:14', 'miral', '2021-05-24 08:32:36'),
(13, 'Business Development Executive', 'business-development-executive', '&lt;div&gt;Objectives of this Role&lt;/div&gt;&lt;ul&gt;&lt;li&gt;Managing both our existing sales pipeline and developing new business opportunities&lt;/li&gt;&lt;li&gt;Take a lead role in the development of proposals and presentations for new business materials to create and nurture business opportunities and partnerships&lt;/li&gt;&lt;li&gt;Identify trends and customer needs, building a short/medium/long-term sales pipeline in accordance with targets&lt;/li&gt;&lt;li&gt;Develop strategies and positions by analyzing new venture integration&lt;/li&gt;&lt;li&gt;Assist in the coordination and implementation of marketing strategies, and delegate tasks that achieve strategic goals&lt;/li&gt;&lt;li&gt;Motivate the team, track performance, and report metrics&lt;/li&gt;&lt;/ul&gt;&lt;div&gt;Daily and Monthly Responsibilities&lt;/div&gt;&lt;ul&gt;&lt;li&gt;Monitor and evaluate industry trends and customer drivers and meet regularly with management and stakeholders to discuss strategy&lt;/li&gt;&lt;li&gt;Manage proposal response process, including detailed RFP requirements, content creation, and &amp;nbsp;inputs from various sources&lt;/li&gt;&lt;li&gt;Generate new leads, identify and contact decision-makers, screen potential business opportunities, select the deals inline with strategies, and lead and facilitate pitch logistics&lt;/li&gt;&lt;li&gt;Develop and implement overarching outbound sales and business development strategy, sales processes, structure, and best practices across the company&lt;/li&gt;&lt;li&gt;Support deal structure and pricing with business value analysis; negotiate prices for proactive bids and proposals&lt;/li&gt;&lt;li&gt;Maintain and share professional knowledge through education, networking, events, and presentations&lt;/li&gt;&lt;/ul&gt;', '35', 1.00, 'miral', '2020-07-24 07:39:58', 'miral', '2023-02-24 05:20:44'),
(14, 'HR - Administration ', 'hr--administration', '&lt;ul&gt;&lt;li&gt;Organize, compile, update company personnel records and documentation&lt;/li&gt;&lt;li&gt;Manage and update HR databases with different information such as new hires, terminations, sick leaves, warnings, vacation and days off&amp;nbsp;&lt;/li&gt;&lt;li&gt;Help in payroll management, preparation and payment&lt;/li&gt;&lt;li&gt;Prepare, manage and store paperwork for HR policies and procedures&lt;/li&gt;&lt;li&gt;Answer employeesâ€™ questions and provide requested information&lt;/li&gt;&lt;li&gt;Maintain schedule and coordinate calendar activities&lt;/li&gt;&lt;li&gt;Assist recruiters in posting job ads on careers pages and processing received resumes&lt;/li&gt;&lt;li&gt;Answer telephone calls and provide needed information&amp;nbsp;&lt;/li&gt;&lt;li&gt;Create reports for senior management&lt;/li&gt;&lt;li&gt;Help organize and manage new employee orientation, on-boarding, and training programs&lt;/li&gt;&lt;/ul&gt;', '35', 1.00, 'miral', '2020-07-24 07:47:25', 'miral', '2022-05-21 09:54:38'),
(15, 'Business Development Executive (On Field)', 'business-development-executive-on-field', '<div>Objectives of this Role</div><ul><li>Managing both our existing sales pipeline and developing new business opportunities</li><li>Take a lead role in the development of proposals and presentations for new business materials to create and nurture business opportunities and partnerships</li><li>Identify trends and customer needs, building a short/medium/long-term sales pipeline in accordance with targets</li><li>Develop strategies and positions by analyzing new venture integration</li><li>Assist in the coordination and implementation of marketing strategies, and delegate tasks that achieve strategic goals</li><li>Motivate the team, track performance, and report metrics</li></ul><div>Daily and Monthly Responsibilities</div><ul><li>Monitor and evaluate industry trends and customer drivers and meet regularly with management and stakeholders to discuss strategy</li><li>Manage proposal response process, including detailed RFP requirements, content creation, and &nbsp;inputs from various sources</li><li>Generate new leads, identify and contact decision-makers, screen potential business opportunities, select the deals inline with strategies, and lead and facilitate pitch logistics</li><li>Develop and implement overarching outbound sales and business development strategy, sales processes, structure, and best practices across the company</li><li>Support deal structure and pricing with business value analysis; negotiate prices for proactive bids and proposals</li><li>Maintain and share professional knowledge through education, networking, events, and presentations</li></ul>', '25', 1.00, 'miral', '2020-08-14 12:03:26', 'miral', '2021-05-26 07:58:27'),
(16, 'Digital Marketing Manager', 'digital-marketing-manager', '<ul><li>Handling strategic online initiatives</li><li>Leading marketing campaigns from the idea stage through to their execution and implementation</li><li>Monitoring and evaluating online media campaigns to keep them fresh and effective</li><li>Directing the hiring of marketing and promotions staff and supervising their work</li><li>Negotiating advertising contracts</li><li>Working with other department heads and staff to discuss plans and marketing strategies</li><li>Collaborating with finance staff to set and stay within budget</li><li>Staying current with emerging opportunities in the digital marketing world</li></ul>', '35', 1.00, 'miral', '2020-09-04 05:56:06', 'miral', '2021-05-24 08:23:35'),
(17, 'Software Testing Analyst', 'software-testing-analyst', '<ul><li>Reviewing software requirements and preparing test scenarios.</li><li>Executing tests on software usability.</li><li>Analyzing test results on database impacts, errors or bugs, and usability.</li><li>Preparing reports on all aspects related to the software testing carried out and reporting to the design team.</li><li>Interacting with clients to understand product requirements.</li><li>Participating in design reviews and providing input on requirements, product design, and potential problems.</li></ul>', '35', 1.00, 'miral', '2020-09-04 05:59:04', 'miral', '2021-05-24 08:23:17'),
(18, 'Customer Relationship Manager', 'customer-relationship-manager', '&lt;div&gt;Objectives of this Role&lt;/div&gt;&lt;ul&gt;&lt;li&gt;Manage a large volume of inbound and outbound calls, emails, and chats with knowledge and efficiency&lt;/li&gt;&lt;li&gt;Identify and address customer needs with a goal of complete satisfaction&lt;/li&gt;&lt;li&gt;Provide expert answers to questions about products, pricing, and availability, while presenting the value of our portfolio of products to customers&lt;/li&gt;&lt;li&gt;Meet customer service department sales targets, generating sales leads when opportunities arise&lt;/li&gt;&lt;li&gt;Follow company communications guidelines and procedures under minimal supervision&lt;/li&gt;&lt;li&gt;Recommend improvements to processes for improved company efficiency&lt;/li&gt;&lt;/ul&gt;&lt;div&gt;Daily and Weekly Responsibilities&lt;/div&gt;&lt;ul&gt;&lt;li&gt;Build expert and dynamic knowledge of company products and services&lt;/li&gt;&lt;li&gt;Research information using available resources to satisfy customer inquiries&lt;/li&gt;&lt;li&gt;Build rapport with customers by engaging with them in an inviting, friendly, and professional manner, to deliver exceptional experiences nurture lasting relationships&lt;/li&gt;&lt;li&gt;Respond quickly, professionally, and accurately to all customer inquiries regarding quotes, orders, status requests, complaints, product returns, and warranties&lt;/li&gt;&lt;li&gt;Meet daily personal/team qualitative and quantitative targets by recommending and explaining benefits of additional company services, and seizing opportunities to sell products and services whenever possible&lt;/li&gt;&lt;li&gt;Maintain daily recordings, and log and document issues and resolutions in an electronic database for sales and executive management teams to review&lt;/li&gt;&lt;/ul&gt;', '35', 1.00, 'miral', '2020-12-05 11:17:41', 'miral', '2023-02-11 14:35:38'),
(19, 'Business Development Associate (On Field)', 'business-development-associate-on-field', '<div>Objectives of this Role</div><ul><li>Managing both our existing sales pipeline and developing new business opportunities</li><li>Take a lead role in the development of proposals and presentations for new business materials to create and nurture business opportunities and partnerships</li><li>Identify trends and customer needs, building a short/medium/long-term sales pipeline in accordance with targets</li><li>Develop strategies and positions by analyzing new venture integration</li><li>Assist in the coordination and implementation of marketing strategies, and delegate tasks that achieve strategic goals</li><li>Motivate the team, track performance, and report metrics</li></ul><div>Daily and Monthly Responsibilities</div><ul><li>Monitor and evaluate industry trends and customer drivers and meet regularly with management and stakeholders to discuss strategy</li><li>Manage proposal response process, including detailed RFP requirements, content creation, and &nbsp;inputs from various sources</li><li>Generate new leads, identify and contact decision-makers, screen potential business opportunities, select the deals inline with strategies, and lead and facilitate pitch logistics</li><li>Develop and implement overarching outbound sales and business development strategy, sales processes, structure, and best practices across the company</li><li>Support deal structure and pricing with business value analysis; negotiate prices for proactive bids and proposals</li><li>Maintain and share professional knowledge through education, networking, events, and presentations</li></ul>', '25', 1.00, 'miral', '2020-12-11 08:11:37', 'miral', '2021-05-26 07:50:17'),
(21, 'Customer Relationship Executive', 'customer-relationship-executive', '&lt;div&gt;Objectives of this Role&lt;/div&gt;&lt;ul&gt;&lt;li&gt;Manage a large volume of inbound and outbound calls, emails, and chats with knowledge and efficiency&lt;/li&gt;&lt;li&gt;Identify and address customer needs with a goal of complete satisfaction&lt;/li&gt;&lt;li&gt;Provide expert answers to questions about products, pricing, and availability, while presenting the value of our portfolio of products to customers&lt;/li&gt;&lt;li&gt;Meet customer service department sales targets, generating sales leads when opportunities arise&lt;/li&gt;&lt;li&gt;Follow company communications guidelines and procedures under minimal supervision&lt;/li&gt;&lt;li&gt;Recommend improvements to processes for improved company efficiency&lt;/li&gt;&lt;/ul&gt;&lt;div&gt;Daily and Weekly Responsibilities&lt;/div&gt;&lt;ul&gt;&lt;li&gt;Build expert and dynamic knowledge of company products and services&lt;/li&gt;&lt;li&gt;Research information using available resources to satisfy customer inquiries&lt;/li&gt;&lt;li&gt;Build rapport with customers by engaging with them in an inviting, friendly, and professional manner, to deliver exceptional experiences nurture lasting relationships&lt;/li&gt;&lt;li&gt;Respond quickly, professionally, and accurately to all customer inquiries regarding quotes, orders, status requests, complaints, product returns, and warranties&lt;/li&gt;&lt;li&gt;Meet daily personal/team qualitative and quantitative targets by recommending and explaining benefits of additional company services, and seizing opportunities to sell products and services whenever possible&lt;/li&gt;&lt;li&gt;Maintain daily recordings, and log and document issues and resolutions in an electronic database for sales and executive management teams to review&lt;/li&gt;&lt;/ul&gt;', '35', 1.00, 'miral', '2020-12-11 08:57:35', 'miral', '2023-02-11 14:34:40'),
(22, 'Sales Representative (On Field)', 'sales-representative-on-field', '<div>Objectives of this Role</div><ul><li>Represent our companyâ€™s products and services, starting with a deep and comprehensive understanding and following with consumer research to identify how our solutions meet needs</li><li>Meet weekly, monthly, and annual sales quotas through the successful implementation of sales and marketing strategies and tactics</li><li>Generate leads and build relationships planning and organizing daily work schedule to call on existing or potential sales outlets</li><li>Develop and implement territory action plan through comprehensive data analysis, and adjust sales techniques based on interactions and results in the field</li></ul><div>Daily and Monthly Responsibilities</div><ul><li>Maintain working relationships with existing clients to ensure exceptional service and identification of potential new sales opportunities</li><li>Identify appropriate prospects, set appointments, make effective qualifying sales calls, and manage sales cycle to close new business in all service categories offered</li><li>Possess in-depth product knowledge and be able to conduct demos and relay objection handling</li><li>Prepare professional, complete, concise and accurate reports, proposals, booking packages, and other documentation as required for executive-level presentations</li><li>Achieve sales goals by assessing current client needs and following an defined selling process with potential buyers, often utilizing product demos and presentations</li><li>Coordinate with other sales reps to ensure company quotas and standards are being met, performing market research and regular competitor monitoring</li></ul>', '25', 1.00, 'miral', '2020-12-11 09:03:31', 'miral', '2021-05-26 07:49:34'),
(24, 'Business Development Manager ', 'business-development-manager', 'Your job as a business development manager is to identify sales leads, pitch goods or services to new clients and maintain a good working relationship with new contacts.&nbsp;This role revolves around good communication and so whatever business you work in your duties are likely to include:<ul><li>Following up new business opportunities and setting up meetings</li><li>Planning and preparing presentations (say hello to PowerPoint)</li><li>Communicating new product developments to prospective clients</li><li>Overseeing the development of marketing literature</li><li>Writing reports</li><li>Providing management with feedback</li></ul>This is no job for shy, retiring types as youâ€™ll need to be bursting with self-confidence, love networking and enjoy presenting and public speaking. It also helps if you have:<ul><li>Good business sense</li><li>A deep understanding of marketing principles</li><li>Good communication skills</li><li>A positive attitude</li><li>Negotiation skills</li><li>Plenty of initiative</li></ul>', '35', 1.00, 'miral', '2020-12-11 09:24:46', 'miral', '2021-05-26 07:48:59'),
(25, 'Business Development Manager (On Field)', 'business-development-manager-on-field', 'Your job as a business development manager is to identify sales leads, pitch goods or services to new clients and maintain a good working relationship with new contacts. This role revolves around good communication and so whatever business you work in your duties are likely to include:<ul><li>Following up new business opportunities and setting up meetings</li><li>Planning and preparing presentations (say hello to PowerPoint)</li><li>Communicating new product developments to prospective clients</li><li>Overseeing the development of marketing literature</li><li>Writing reports</li><li>Providing management with feedback</li></ul>This is no job for shy, retiring types as youâ€™ll need to be bursting with self-confidence, love networking and enjoy presenting and public speaking. It also helps if you have:<ul><li>Good business sense</li><li>A deep understanding of marketing principles</li><li>Good communication skills</li><li>A positive attitude</li><li>Negotiation skills</li><li>Plenty of initiative</li></ul>', '35', 1.00, 'miral', '2020-12-11 10:00:36', 'miral', '2021-05-26 07:48:33'),
(26, 'Content Writer', 'content-writer', '<li>Research industry-related topics (combining online sources, interviews and studies)</li><li>Write clear marketing copy to promote our products/services</li><li>Prepare well-structured drafts using Content Management Systems</li><li>Proofread and edit blog posts before publication</li><li>Submit work to editors for input and approval</li><li>Coordinate with marketing and design teams to illustrate articles</li><li>Conduct simple keyword research and use SEO guidelines to increase web traffic</li><li>Promote content on social media</li><li>Identify customersâ€™ needs and gaps in our content and recommend new topics</li><li>Ensure all-around consistency (style, fonts, images and tone)</li><li>Update website content as needed</li>', '35', 1.00, 'miral', '2021-05-24 07:27:53', 'miral', '2021-05-24 08:16:33'),
(27, 'Web Designer', 'web-designer', 'Web Designers are responsible for designing and building the interface, navigation and aesthetic of websites for businesses and clients. Likely working in the IT team of an organization or for a digital design agency that services clients, Web Designers should possess a range of skills and qualities. A Web Designer job description should ask for candidates that are experts in design best practice, understand user and client needs, and be excellent&nbsp;communicators.<br><br><b>Web Designer Duties and Responsibilities:&nbsp;<br></b><b><br>Requiring both technical and creative skills, a Web Designer job description typically includes some of these tasks and duties:</b><ul><li>Designing engaging and responsive landing pages</li><li>Integrating client CMS programs and data feeds into websites</li><li>Optimising sites for maximum speed and scalability</li><li>Employing industry and design best practice through website build process</li><li>Conducting website testing</li><li>Liaising with back-end developers to ensure web and app logic is properly integrated</li><li>Ensuring website function and stability across devices i.e. desktop, mobile, tablet</li><li>Working with marketing and research teams to incorporate brand elements and relevant market research findings into website</li><li>Providing internal support and external customer service throughout the build and launch process of the website</li></ul>', '35', 1.00, 'miral', '2021-08-12 10:05:58', 'miral', '2021-08-12 10:09:22'),
(28, 'Photographer', 'photographer', '&lt;ul&gt;&lt;b&gt;Responsibilities for Photographer&lt;br&gt;&lt;br&gt;&lt;/b&gt;&lt;li&gt;Take professional pictures in a studio or on location&lt;/li&gt;&lt;li&gt;Work closely with clients and colleagues to produce high-quality photographic images&lt;/li&gt;&lt;li&gt;Use different techniques to enhance the photographs as required&lt;/li&gt;&lt;li&gt;Use photo manipulation software such as Adobe Suite to get desired results&lt;/li&gt;&lt;li&gt;Recommend creative ideas to exceed expectations of goals and objectives&lt;/li&gt;&lt;li&gt;Use artistic knowledge to enhance and compose photographs&lt;/li&gt;&lt;li&gt;Review sets of photographs and select the best results&lt;/li&gt;&lt;li&gt;Operate various photographic equipment such as single lens reflex cameras and film or digital cameras and lighting&lt;/li&gt;&lt;/ul&gt;', '35', 1.00, 'miral', '2021-08-12 10:21:41', 'miral', '2021-08-26 04:56:40'),
(29, 'Office Boy', 'office-boy', '&lt;ul&gt;&lt;li&gt;Ensure an organized, clean, and tidy workspace.&lt;/li&gt;&lt;li&gt;Maintain and re-stock office supplies as needed.&lt;/li&gt;&lt;li&gt;Manage guest&lt;/li&gt;&lt;li&gt;serve refreshments&lt;br&gt;&lt;/li&gt;&lt;/ul&gt;&lt;br&gt;', '25', 1.00, 'hinalsavani', '2021-12-15 06:57:13', 'miral', '2022-04-13 12:38:20'),
(30, 'Cyber Security Analyst', 'cyber-security-analyst', '&lt;div&gt;&lt;b&gt;Objectives of this Role&lt;/b&gt;&lt;/div&gt;&lt;ul&gt;&lt;li&gt;Guard all Company Website, Application, company data, particularly sensitive data, from both internal and external threats by designing broad defenses against would-be intruders&lt;/li&gt;&lt;li&gt;Take the lead on day-to-day monitoring for unusual activities, implement defensive protocols, and report incidents&lt;/li&gt;&lt;li&gt;Collaborate with other members of the cybersecurity team to develop new protocols, layers of protection, and other both proactive and defensive systems that stay one step ahead of cyber criminals&lt;/li&gt;&lt;li&gt;Maintain security guidelines, procedures, standards and controls documentation&lt;/li&gt;&lt;li&gt;Maintain a working knowledge of current cybercrime tactics&lt;/li&gt;&lt;/ul&gt;&lt;div&gt;&lt;b&gt;Daily and Monthly Responsibilities&lt;/b&gt;&lt;/div&gt;&lt;ul&gt;&lt;li&gt;Collect data on current security measures for risk analysis and write regular systems-status reports&lt;/li&gt;&lt;li&gt;Constantly monitor for attack and run appropriate defensive protocols if breaches occur&lt;/li&gt;&lt;li&gt;Conduct vulnerability testing to identify weaknesses and collaborate with cybersecurity team to update defensive protocols as necessary&lt;/li&gt;&lt;li&gt;Configure anti-virus systems, firewalls, data centers and software updates with a security-first mindset&lt;/li&gt;&lt;li&gt;Grant credentials to authorized users, monitor access-related activities and check for unregistered information changes&lt;/li&gt;&lt;li&gt;Help lead employee training against phishing and other forms of cyberattack&lt;/li&gt;&lt;/ul&gt;', '35', 1.00, 'miral', '2022-02-22 07:41:45', 'miral', '2022-02-22 07:41:45');
