s properly integrated</li><li>Ensuring website function and stability across devices i.e. desktop, mobile, tablet</li><li>Working with marketing and research teams to incorporate brand elements and relevant market research findings into website</li><li>Providing internal support and external customer service throughout the build and launch process of the website</li></ul>', 1, 4, 1, '09:30:00', '18:30:00', '09:00:00', 'NO', 'YES', 1, 1, '2022-06-13 14:05:02', 'charmithakor', '2022-09-05 11:38:15', 'charmithakor', 'Y', 'LMGE0198', 'AJOPJ5839R ', 'pan_card_anmoljamakhandikar-14062022_11_43_31-Pan card.pdf', '7078 0282 0209', 'aadhar_card_anmoljamakhandikar-14062022_11_43_31-anmol Adhaar card.pdf', 'equitas small finance bank', 'H S R LAYOUT', '100012440036', 'ESFB0003003', 'Anmol Raju Jamakhandikar', 'cancel_cheque_doc_anmoljamakhandikar-14062022_11_43_31-niyox bank statement.pdf', NULL, 0, NULL, NULL, NULL, '1', '', '', '', '', '', '', '', '', '', '', '', '', '1', NULL, 0, NULL),
