ign best practice through website build process</li><li>Conducting website testing</li><li>Liaising with back-end developers to ensure web and app logic is properly integrated</li><li>Ensuring website function and stability across devices i.e. desktop, mobile, tablet</li><li>Working with marketing and research teams to incorporate brand elements and relevant market research findings into website</li><li>Providing internal support and external customer service throughout the build and launch process of the website</li></ul>', 1, 2, 1, '09:30:00', '18:30:00', '09:00:00', 'NO', 'NO', 3, 1, '2022-11-02 11:19:54', 'swatinandanwar', '2022-11-03 10:09:56', 'charmithakor', 'Y', 'LMGE0236', 'BRQPC8912B', 'pan_card_anandchauhan-02112022_12_47_55-pan card Anand .pdf', '730894457520', 'aadhar_card_anandchauhan-02112022_12_47_55-aadhar card Anand .pdf', 'ICICI BANK', 'ATHWALINES', '005201563791', 'ICIC0000052', 'ANAND CHAUHAN', 'cancel_cheque_doc_anandchauhan-02112022_12_47_55-Aanand .pdf', NULL, 1, 'Desktop', NULL, NULL, '2', 'Anand chauhan', 'anand.chauhan@differenzsystem.com', 'NA', 'surat', '02/08/2021 - 11/02/2022', 'web-designer', 'Arun gupta', '7405380102', 'colleauge', 'meet parmar', '8320678188', 'colleauge', '1', 'anandchauhan_list_of_document_submitted.pdf', 0, NULL),
