INSERT INTO `tblnews` (`nid`, `ntitle`, `ndetails`, `ndate`, `designation_id`) VALUES
(2, 'A year into the pandemic, social media commerce sees a surge with 40 per cent consumers logging in to purchase', '<div>A year into the pandemic, as consumers look to minimise touchpoints that could lead to viral transmission, there has been a marked preference for contactless payment, voice-activated shopping and social commerce.</div><div><br></div><div>Loyalty program InterMilesâ€™ maiden â€˜Consumer Spending Sentiment Index Reportâ€™ found that 70 per cent of consumers have shifted payment preferences from cash or card to UPI or e-wallets post the pandemic outbreak. 44 per cent of consumers even said that theyâ€™ve started using UPI services more than cash or cards.</div><div><br></div><div>The report, based on responses from more than 11,500 members across India, also found that there is a sure shift to social commerce with as many as 40 per cent of consumers stating that they now use social media channels like Facebook and Instagram more frequently for shopping. This instant content to commerce behavior is anticipated to revolutionize the marketing ecosystem in the country, while also allowing SMMEs increased visibility at low costs. 31 per cent of respondents said that their usage of digital voice assistants like Alexa and Google Home, for shopping, increased through the course of the pandemic.</div><div><br></div><div>Reduced Discretionary Spending</div><div>The pandemic has spurred renewed caution with regards to purchasing. Given the uncertainty and suddenness of the global pandemic, close to 70 per cent of Indians have now placed greater emphasis on securing the future by increasing investments and savings. Spending priorities have taken a turn, with 21 per cent of consumers increasing spends on essential products, while non-essential spending saw an almost negligible (3 per cent) increase post the advent of the pandemic</div><div><br></div><div>Expenditure on essential goods and services like food products and healthcare saw a substantial increase by 45 per cent and 38 per cent respectively while consumer spends on non-essentials like travel, entertainment and apparel saw a steep decline, decreasing by 68 per cent, 52 per cent and 45 per cent respectively.</div>', '2021-04-06 01:54:22', ''),
(3, 'News for Specified Designation', '3. Admin Technical Support<br>4. Tele-Caller<br>5. Business Developer Executive<br>6. HR - Administration', '2021-07-07 11:21:28', '5,9,10,13,14');
