INSERT INTO `tblratingmaster` (`id`, `rate_criteria_title`, `rate_criteria_desc`, `applied_to_team`, `rating_level`, `addedBy`, `create_datetime`, `update_datetime`) VALUES
(1, 'Creativity and innovation', 'Creativity is essential in the workplace for creative thinking and problem-solving. ', '0', 5, 'miral', '2021-07-31 11:30:27', '0000-00-00 00:00:00'),
(2, 'Adaptability', 'It is important that employees adapt to change and accept and comply with new processes', '0', 5, 'miral', '2021-07-31 17:46:49', '0000-00-00 00:00:00'),
(3, 'Communication', 'Communicating effectively with supervisors, colleagues and clients is essential throughout various industries.', '0', 5, 'miral', '2021-07-31 11:31:49', '0000-00-00 00:00:00'),
(4, 'Productivity and quality of work', 'It is essential that employees remain productive during work hours to contribute to the company’s goals. Productivity is also a good indicator of an employee’s engagement.', '0', 5, 'miral', '2021-07-31 11:32:47', '0000-00-00 00:00:00'),
(5, 'Cooperation', 'Cooperation is important to evaluate because an employee should be willing to cooperate with their co-workers to make sure team-based projects and daily tasks are completed in a timely manner. When each person relies on input from others to complete a task, the workflow continues at a steady pace which can only be achieved through cooperation. ', '1', 5, 'miral', '2021-07-31 14:45:47', '0000-00-00 00:00:00'),
(6, 'Interpersonal skills', 'Good interpersonal skills combine multiple skills that are often prerequisites for many jobs.', '0', 5, 'miral', '2021-07-31 11:34:28', '0000-00-00 00:00:00'),
(7, 'Problem solving', 'Problem solving defines a problem to determine its cause, identifying possible solutions and choosing the correct solution.', '1,2', 5, 'miral', '2021-07-31 11:40:40', '0000-00-00 00:00:00');
